
import Select from "react-select";
import { actorPeliculaDTO } from "./actores.model";
import { useState } from "react";
import { DndContext, DragEndEvent } from "@dnd-kit/core";
import {
  arrayMove,
  SortableContext,
  useSortable,
  verticalListSortingStrategy
} from "@dnd-kit/sortable";
import { CSS } from "@dnd-kit/utilities";

export default function TypeAheadActores(props: TypeAheadActoresProps) {
  const [actoresSeleccionados, setActoresSeleccionados] = useState<actorPeliculaDTO[]>([]);

  const actores: actorPeliculaDTO[] = [
        {
            id: 1,
            nombre: 'tom',
            personaje: '',
            foto: 'data:image/webp;base64,'
        },
        {
            id: 2,
            nombre: 'tobey',
            personaje: '',
            foto: 'data:image/webp;base64,'
        },
        {
            id: 3,
            nombre: 'Andrew',
            personaje: '',
            foto: 'data:image/webp;base64,'
        }

    ];

  const handlePersonajeChange = (id: number, personaje: string) => {
    setActoresSeleccionados((prev) =>
      prev.map((actor) =>
        actor.id === id ? { ...actor, personaje } : actor
      )
    );
  };

  const handleDragEnd = (event: DragEndEvent) => {
    const { active, over } = event;

    if (active.id !== over?.id) {
      setActoresSeleccionados((prevActores) => {
        const oldIndex = prevActores.findIndex((actor) => actor.id.toString() === active.id.toString());
        const newIndex = prevActores.findIndex((actor) => actor.id.toString() === over?.id.toString());

        return arrayMove(prevActores, oldIndex, newIndex);
      });
    }
  };

  const options = actores.map((actor) => ({
    value: actor.id,
    label: actor.nombre,
    actor
  }));

  return (
    <>
      <label htmlFor="select-actor">Actores</label>
      <Select
        id="select-actor"
        options={options}
        onChange={(selected) => {
          if (selected && !actoresSeleccionados.some((a) => a.id === selected.actor.id)) {
            setActoresSeleccionados([...actoresSeleccionados, selected.actor]);
            props.onAdd(selected.actor);
          }
        }}
        formatOptionLabel={(option) => (
          <div style={{ display: "flex", alignItems: "center" }}>
            <img
              alt="imagen actor"
              src={option.actor.foto}
              style={{
                height: "64px",
                width: "64px",
                marginRight: "10px",
                objectFit: "cover",
                borderRadius: "5px"
              }}
            />
            <span>{option.actor.nombre}</span>
          </div>
        )}
      />

      <div style={{ marginTop: "20px" }}>
        <h4>Actores seleccionados:</h4>
        <DndContext onDragEnd={handleDragEnd}>
          <SortableContext
            items={actoresSeleccionados.map((actor) => actor.id.toString())}
            strategy={verticalListSortingStrategy}
          >
            <div style={{ display: "flex", flexWrap: "wrap", gap: "15px" }}>
              {actoresSeleccionados.map((actor) => (
                <ActorSortableItem
                  key={actor.id}
                  actor={actor}
                  onRemove={() => {
                    setActoresSeleccionados(prev => prev.filter(a => a.id !== actor.id));
                    props.onRemove(actor);
                  }}
                  onChangePersonaje={(personaje) =>
                    handlePersonajeChange(actor.id, personaje)
                  }
                />
              ))}
            </div>
          </SortableContext>
        </DndContext>
      </div>
    </>
  );
}

function ActorSortableItem({
  actor,
  onRemove,
  onChangePersonaje
}: {
  actor: actorPeliculaDTO;
  onRemove: () => void;
  onChangePersonaje: (personaje: string) => void;
}) {
  const {
    setNodeRef,
    transform,
    transition,
    listeners,
    attributes
  } = useSortable({
    id: actor.id.toString()
  });

  const style: React.CSSProperties = {
    transform: CSS.Transform.toString(transform),
    transition: transition || "transform 200ms ease",
    textAlign: "center",
    cursor: "grab",
    border: "1px solid #ccc",
    padding: "10px",
    borderRadius: "8px",
    width: "120px",
    backgroundColor: "#f9f9f9"
  };

  return (
    <div ref={setNodeRef} style={style} {...attributes} {...listeners}>
      <img
        src={actor.foto}
        alt={actor.nombre}
        style={{
          height: "64px",
          width: "64px",
          objectFit: "cover",
          borderRadius: "5px",
          display: "block",
          marginBottom: "5px"
        }}
      />
      <span>{actor.nombre}</span>
      <br />
      <input
        type="text"
        placeholder="Personaje"
        value={actor.personaje}
        onChange={(e) => onChangePersonaje(e.target.value)}
        className="form-control"
        style={{ marginBottom: "5px" }}
      />
      <br />
      <button
        type="button"
        className="btn btn-danger btn-sm"
        onClick={onRemove}
      >
        Remover
      </button>
    </div>
  );
}

interface TypeAheadActoresProps {
  actores: actorPeliculaDTO[];
  onAdd(actor: actorPeliculaDTO): void;
  onRemove(actor: actorPeliculaDTO): void;
  onChange?(actorActualizado: actorPeliculaDTO): void;
}
